import React from 'react';

const properti = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <h1>Properti</h1>
    </div>
  );
};

export default properti;
